async function draw_text(content,x,y,w,h,hexcolor,shadow) {
    let color = shadow ? b : hexcolor
    let bold = shadow ? bld : 1
    istext = await ImageScript.Image.renderText(font, 75-(parseInt(content.length)/7.5), String(content), color, layout);
    istext.resize(istext.width*w,istext.height*h)
    back.composite(istext, x+bold, y+bold);
    if(shadow) return draw_text(content,x,y,w,h,hexcolor,false)
    return istext
}

