ON @*:TEXT:*:#: {
  if ($nick !isreg $chan) { return }

  tokenize 32 $strip($1-)

  var %sha = $sha512($lower($1-),0)
  var %content = $+(CONTENT,$chr(166),$network,$chr(166),$nick,$chr(166),$chan)
  var %repeats = $+(REPEATS,$chr(166),$network,$chr(166),$nick,$chr(166),$chan)

  if (!$hget(RP,%content)) || ($hget(RP,%content)) && ($hget(RP,%content) !== %sha) { hadd -m RP %repeats 1 }

  if ($hget(RP,%content)) && ($hget(RP,%content) == %sha) {
    hinc -m RP %repeats 1

    if ($hget(RP,%repeats) == 3) {
      msg $chan 👉 04[ 12 $+ $nick 04], Wir dulden keine Wiederholungen, da diese von den anderen Nutzern als störend empfunden werden. Weitere Wiederholungen von dir führen zu einem Ausschluß vom Chat.
    }

    elseif ($hget(RP,%repeats) == 4) {
      kick $chan $nick Wir dulden keine Wiederholungen, da diese von den anderen Nutzern als störend empfunden werden.
    }

    elseif ($hget(RP,%repeats) == 5) {
      ban -k $chan $nick 2 Gebannt: Wir dulden keine Wiederholungen, da diese von den anderen Nutzern als störend empfunden werden.

      hdel RP %content
      hdel RP %repeats

      return
    }

  }

  hadd -m RP %content %sha
}

