# Definition for a binary tree node.
# class TreeNode:
#     def __init__(self, val=0, left=None, right=None):
#         self.val = val
#         self.left = left
#         self.right = right
class Solution:
    def isSymmetric(self, root: Optional[TreeNode]) -> bool:
        
        #Idea: 
        # is_mirror(u, v) = True neu subtree o u va subtree o v doi xung voi nhau.
        # 1. u.val = v.val
        # 2. is_mirror(u.left, v.right) = True
        # 3. is_mirror(u.right, v.left) = True

        #TC: O(1) * N = O(N)
        #SC: H * O(1) = O(H) -->(= O(N))
        def is_mirror(u, v):

            if u is None:
                return v is None

            if v is None:
                return False 
            
            return u.val == v.val and is_mirror(u.left, v.right) and is_mirror(u.right, v.left)
        
        return is_mirror(root.left, root.right)

