{ 


    hDll = LoadLibrary("resource/dll/my.dll"); 
    
    if(hDll == 0) 
	{
		printf("Error load of dll-library!\n");

        return 0; 
    }
    
   _retDate = (int(*)(const char *, int) )GetProcAddress(hDll, "_retDate");
   
    
    if(_retDate == 0) 
    {
		printf("Error load func a.\n");
        FreeLibrary(hDll);
        return 0; 
    }

return 0; 
}   





